import Avatar from "../avatar/Avatar";
import Logo from "../logo/Logo";
import "./Header.scss";

function Header() {
  return (
    <div>
      <h1>Hello World!</h1>
      <Avatar />
      <Logo />
    </div>
  );
}

export default Header;
